{"txtMove.x":"this.widthU() * (2 / 15)","txtSize.width":"this.widthU() * (11 / 15)","size.height":"var size;

switch (Vecta.activePage.unit()) {
 case 'in':
 size = this.text() === '' ? 0.775 : Math.ceil((new Vecta.Length(this.textHeight()).in() + 0.25) / 0.25) * 0.25;
 (size < 0.775 ? 0.775 : size) + 'in';
 break;
 case 'cm': //2.4cm
 size = this.text() === '' ? 2 : Math.ceil((new Vecta.Length(this.textHeight()).cm() + 0.5) / 0.5) * 0.5;
 (size < 2 ? 2 : size) + 'cm';
 break;
 case 'mm': //24mm
 size = this.text() === '' ? 20 : Math.ceil((new Vecta.Length(this.textHeight()).mm() + 5) / 5) * 5;
 (size < 20 ? 20 : size) + 'mm';
 break;
 default:
 size = this.text() === '' ? 70 : Math.ceil((this.textHeight() + 10) / 10) * 10;
 size < 70 ? 70 : size;
}"}
